import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)`
  color: white; /* Set text color to white */
  font-family: 'Inter'; /* Change the font */
`;

const TransparentTableRow = styled(TableRow)`
  background-color: transparent !important; /* Set row color to transparent */
`;

const TableContainerStyled = styled(TableContainer)`
  background-color: transparent !important; /* Set table background color to transparent */
`;

function createData(ApptID, calories, fat, carbs, protein) {
  return { ApptID, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function Appoint_Tble() {
  return (
    <TableContainerStyled component={Paper}>
      <Table sx={{ width: '40%' }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Appt.ID</StyledTableCell>
            <StyledTableCell align="left">Customer Name</StyledTableCell>
            <StyledTableCell align="left">Date</StyledTableCell>
            <StyledTableCell align="left">Time</StyledTableCell>
            <StyledTableCell align="left">Comm. method</StyledTableCell>
            <StyledTableCell align="lefts">Description</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TransparentTableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="left">{row.calories}</StyledTableCell>
              <StyledTableCell align="left">{row.fat}</StyledTableCell>
              <StyledTableCell align="left">{row.carbs}</StyledTableCell>
              <StyledTableCell align="left">{row.protein}</StyledTableCell>
              <StyledTableCell align="left">{row.protein}</StyledTableCell>
            </TransparentTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainerStyled>
  );
}
